import "./Goal.css";

function Goal() {
  return (
    <div className="goal">
      <h1>Our Goals</h1>
      <p>
        Maecenas laoreet nunc ut tincidunt consectetur. Maecenas ipsum velit,
        sagittis id est ac, mattis bibendum dui.
      </p>
    </div>
  );
}

export default Goal;
